const IconContainer = ({ onClick, children }) => (
    <span onClick={onClick} className={styles.iconContainer}>{children}</span>
)



export const IconComponent = ({ iconType, onClick }) => {
    const IconComponent = icons[iconType];

    return IconComponent
        ? <IconContainer
            onClick={onClick}
        >
            <IconComponent />
        </IconContainer>
        : null;
};

